import React, { Fragment } from 'react';

import { grabbyLogo } from '../../assets/grabbyLogo.png';
import styles from './Header.module.css';

const Header = (props) => {
  return (
    <Fragment>
      <header className={styles.header}>
        <h1>Canabis club</h1>
        <button>Cart</button>
      </header>
      <div className={styles["main-image"]}>
        <img src={grabbyLogo} alt="grabby-logo" />
      </div>
    </Fragment>
  );
};

export default Header;
